import React from "react";

function ProductDetails() {
  return (
    <>
      <h1>Product Details</h1>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
        <li>Product 4</li>
      </ul>
    </>
  );
}

export default ProductDetails;
